import React from 'react';
import ReactDOM from 'react-dom';
import Profile from './Profile';

const App = (props) => {
  return <div className="app">
     <Profile />
     <div className="dark-mode">
      <DarkMode></DarkMode>
    </div>
    <div className="tic-tac-toe">
     <Tic-Tac-Toe/>
    </div>
    <div className="todo">
      <h1>Todo</h1>
    </div>
  </div>
}

ReactDOM.render(
  <App />,
  document.getElementById('app'),
);
